# In a nutshell

### Motivation

- Housing markets deepen and structure economic inequalities along two dimensions: Homeownership and residential geography .cyan[.font70[(Ansell 2019; Baldenius et al. 2019)]]
- Extensive research on the effects of subnational housing markets  on the demand-side .cyan[.font70[(e.g., Larsen et al. 2019; Ansell et al. 2022; Cohen, forthcoming)]]
- .cyan[However:] Little to none on their effects on the supply-side

--

### What do we do in this paper?

- Study MPs' strategic responses to housing markets in their electoral districts in Germany
- Argue that MPs deviate from party's platforms via 'selective emphasis', not 'direct confrontation'
- Use a novel framework for salience and position estimation based on MPs' Tweets
- Combine these with georeferenced housing ads and small-area census and administrative data
- Test our argument in cross-sectional + longitudinal perspectives

---

# Theoretical framework

---

# Strategic dilemmas of dyadic representation

In territorial representation systems, MPs face competing principals .cyan[.font70[(Carey 2007)]]
- Their national party
- Their local constituents
    
--

When principals' interest diverge, both parties and MPs face a .cyan[strategic dilemma]
- Electoral benefits of responsiveness to constituency demands (dyadic representation)
- Organizational and electoral costs of jeopardizing party unity
    
--

Existing research studies both sides of this trade-off:
- MPs build personal platforms and engage in dyadic representation .cyan[.font70[(e.g., Baumann et al. 2015; Geschwend and Zittel 2015; Hanretty et al. 2017; Schwarz et al. 2017; Zittel et al. 2019)]]
- Party whips and selectorates sanction deviations from the party line .cyan[.font70[(e.g., Bäck and Debus 2018; Baumann et al. 2017; Proksch and Slapin 2012, Rehmert 2020)]]
    

---

# Direct confrontation vs selective emphasis

#### Argument

- Like competing parties, MPs' can build distinct platforms through different mechanisms .cyan[.font70[(cf. Downs 1957, Budge and Farlie 1983a,b)]]:
    - 'Direct confrontation': MPs support (oppose) policies their party opposes (supports)
    - 'Selective emphasis': MPs emphasize those policies of their party that are electorally opportune
    
--

#### Direct confrontation

- Strategic dilemma: Representation-unity trade-off due to policy disagreement
- Risks rifts between parties and MPs, particularly so on polarized issues (where opposing party's stance = supporting competitor's stance)

--

#### Selective emphasis

- Avoids .cyan[genuine] positional confrontation between parties and MP `\(\rightarrow\)` No policy disagreements
- MPs build a personal platform by 'choosing from their party's menu' to their constituents' liking

---

# Institutional context


Germany is a mixed-member system with a strong emphasis on .cyan[territorial representation]:

- `\(\leq\)` half of the seats in parliament are won via plurality votes in 299 electoral districts
- `\(\geq\)` half of the seats are won via closed party lists at the state-level
- `\(&gt;\)` 80% of elected MPs compete for a district mandate
- Even if defeated in their district, list MPs maintain district offices to act as local ambassadors
- Previously defeated district competitors often seek renomination in their district
- State-level selectorates reward district candidacies with better list positions
- Not one but two local principals: Constituents and district selectorates

# Expectations

#### Focus: Effects of rent-to-income ratios

- Differential effects of rent-to-income ratios in high and low-ownership districts:
- .cyan[High] rent-to-incomes ratios activate distributional conflicts:
    - for renters, they signify reductions of discretionary incomes
    - for homeowners, they signify disproportionately asset values
- .cyan[Low] rent-to-income ratios hardly activate distributional conflicts

--

#### Hypotheses

- Higher salience of housing policy in high-pressured (low ownership, high rent-to-income) districts
- Unambiguous party platforms + high issue polarization `\(\rightarrow\)` no .cyan[genuine] positional responses to local housing markets
- Instead, .cyan[implicit] positional diversification via .cyan[selective emphasis] in high-pressured markets:
    - Left-wing MPs will take stronger positions on 'leftist' market control policies
    - Right-wing MPs will take stronger positions on 'rightist' supply-side subsidies


---

# Empirical strategy

---

# Legislator-level salience and position scores

1. &lt;details&gt;&lt;summary&gt;Annotation of 1200 keyword-filtered tweets&lt;/summary&gt;
&lt;img src="housing-akw_files/figure-html/annotation-plot-1.png" width="100%" style="display: block; margin: auto;" /&gt;
&lt;/details&gt;
--

2. Fine-tuning of BERT
--

3. Classification of tweets as being about (1) market control, (2) supply-side subsides, (3) both, or (4) neither
--

4. Classification of tweets in (1)-(3) as left (-1), right (+1), or neutral (0)
--

5. Prediction and inference via Bayesian hierarchical models with legislator + district REs
    - salience: hierarchical logistic models
    - positions: bivariate hierarchical logistic models

---

# Main predictors and other covariates

### Main predictors

1. .cyan[District-level rent-to-income ratios:]
    - Aggregations of 2017 square meter base rents, based on millions of geo-referenced housing ads
    - Aggregations from municipality-level data on average 2017 taxable per capita incomes
2. .cyan[District-level ownership rates]
    -  Aggregations of numbers of renter/owner-occupied housing units per hectare (2011 censes)
    
### Other covariates

1. Party fixed effects
1. Spokesperson of parliamentary group for housing
1. Role in committee for Construction, Housing, and Development (none/deputy/member/leading)
1. District winner
1. Competed in Eastern/Western district

# Summary and outlook

---

# Summary

We have:

- presented a novel argument and preliminary evidence of the subnational diversification of housing policy supply

--

- moved beyond existing literature on (dyadic) representation by integrating mechanisms of platform building from the party competition literature

--

- shown that MPs use .cyan[selective emphasis], not .cyan[direct confrontation], to cater for constituents' interests

--

- shown that this holds especially for left-wing MPs' emphasis on pro-market control statements in high-pressured district housing markets

---

# Next steps

1. Update and extend manual annotation scheme for classification

2. Semantic and predictive validations of classifications

3. Simpler (e.g., categorical) measurement of housing markets

4. Sensitivity to scope conditions (MP performance, district characteristics)

5. Validation of pre-post design (width of time spans, pre-existing time trends)

<script>
slideshow._releaseMath = function(el) {
  var i, text, code, codes = el.getElementsByTagName('code');
  for (i = 0; i < codes.length;) {
    code = codes[i];
    if (code.parentNode.tagName !== 'PRE' && code.childElementCount === 0) {
      text = code.textContent;
      if (/^\\\((.|\s)+\\\)$/.test(text) || /^\\\[(.|\s)+\\\]$/.test(text) ||
          /^\$\$(.|\s)+\$\$$/.test(text) ||
          /^\\begin\{([^}]+)\}(.|\s)+\\end\{[^}]+\}$/.test(text)) {
        code.outerHTML = code.innerHTML;  // remove <code></code>
        continue;
      }
    }
    i++;
  }
};
slideshow._releaseMath(document);
